graphql.query:
mutation ($payload:IamCreateRoleInput!)
{
	iamCreateRole (payload:$payload)
	{
		id
		rowId
		name
		defaultRedirection
		hasHiddenVerticalNavigation
		isMaster
	}
}

query ($query:QueryStatement $constraint:QueryStatement)
{
	iamPaginateRoles (query:$query constraint:$constraint)
	{
		total
		count
		rows
	}
}
